@FoxNews I worked with @SenJoniErnst to write and pass Sarah’s Law to ensure that illegal immigrants who harm or kill Americans are detained without bail and fully punished.

I’m grateful that President Trump signed this lifesaving legislation into law in January.

Accountability is here.

Senator @ChuckGrassley is conducting an excellent nomination hearing for President Trump's pick to lead the Department of Justice.

@PamBondi will enforce our nation's laws and protect our constitutional rights!

She must be confirmed expeditiously!

Our farmers and producers deserve a five-year Farm Bill that strengthens agriculture &amp; protects our food security.

@HouseAgGOP did our job when we passed our Farm Bill back in May.

Regrettably, Senate Democrats opted instead to play politics with the wellbeing of Rural America.

Senate Democrats never passed the Farm Bill.

@HouseAgGOP did — in May!

Democrats continue to turn their backs on America’s farmers and rural communities.

Another day &amp; Senate Democrats still haven’t released their own version of the Farm Bill.

@HouseAgGOP passed the Farm Bill 147 days ago with bipartisan support.

Our plan strengthens crop insurance, increases reference prices, and includes provisions to grow our export markets!
